sys_variable_value.value:
(function execute(inputs, outputs) {
var currencyAmount = inputs.currency + ";" + inputs.amount.toString();
var gr_expense_line = new GlideRecord("x_avnet_04_reyno_0_expense_line_item");
  gr_expense_line.get(inputs.sysId);
  gr_expense_line.expense_amount.setDisplayValue(currencyAmount);
  gr_expense_line.update();
})(inputs, outputs);

